import axios from "axios";

const URL = 'http://localhost:8080';

export function addEmpToDB() {
    const data = {
        name: 'Aaryan',
        role: 'Trainer',
        salary: 10000,
        exp: 10
    };
    axios.post(URL + '/addEmp', data).then(res => {
        console.log(res.data);

        return res.data;
    })
}
